import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import LoginDesign from '../components/LoginDesign/LoginDesign';

export default function Routes() {
	return (
		<BrowserRouter>
			<Switch>
				<Route
					exact
					path="/"
					component={props => {
						return <LoginDesign {...props} />;
					}}
				/>
			</Switch>
		</BrowserRouter>
	);
}
